import React, {useState, useEffect} from "react";
import './Home.css';
import {Header, Table, Icon} from "semantic-ui-react";
import {BACKEND} from "../config";
import axios from 'axios';

const Home = () => {
  const [data, setData] = useState([]);
  const [rows, setRows] = useState([]);
  useEffect(() => {
    axios.get(`${BACKEND}/get_data`)
      .then(response=>{
        console.log(JSON.parse(response.data))
        // setData(response.data)
      })
      .catch(err=>{
        console.log(err);
      })
  }, []);

  useEffect(() => {
    let temp_rows = data.map(row => {
      return (
        <Table.Row>
          <Table.Cell>Ok</Table.Cell>
          <Table.Cell>Region</Table.Cell>
          <Table.Cell>Country</Table.Cell>
          <Table.Cell>Item Type</Table.Cell>
          <Table.Cell>Sales Channel</Table.Cell>
          <Table.Cell>Order Priority</Table.Cell>
          <Table.Cell>Order Date</Table.Cell>
          <Table.Cell>Order ID</Table.Cell>
          <Table.Cell>Ship Data</Table.Cell>
          <Table.Cell>Units Sold</Table.Cell>
          <Table.Cell>Unit Price</Table.Cell>
          <Table.Cell>Unit Cost</Table.Cell>
          <Table.Cell>Total Revenue</Table.Cell>
          <Table.Cell>Total Cost</Table.Cell>
          <Table.Cell>Total Profit</Table.Cell>
        </Table.Row>
      )
    });
  }, [data]);

  return (
    <div className="container">
      <div className="header">
        <Header as='h2'>
          <Icon name='settings' />
          <Header.Content>
            Reports
          </Header.Content>
        </Header>
      </div>
      <div className="table">
        <Table unstackable>
          <Table.Header>
            <Table.Row>
              <Table.HeaderCell>Order ID</Table.HeaderCell>
              <Table.HeaderCell>Region</Table.HeaderCell>
              <Table.HeaderCell>Country</Table.HeaderCell>
              <Table.HeaderCell>Item Type</Table.HeaderCell>
              <Table.HeaderCell>Sales Channel</Table.HeaderCell>
              <Table.HeaderCell>Order Priority</Table.HeaderCell>
              <Table.HeaderCell>Order Date</Table.HeaderCell>
              <Table.HeaderCell>Order ID</Table.HeaderCell>
              <Table.HeaderCell>Ship Data</Table.HeaderCell>
              <Table.HeaderCell>Units Sold</Table.HeaderCell>
              <Table.HeaderCell>Unit Price</Table.HeaderCell>
              <Table.HeaderCell>Unit Cost</Table.HeaderCell>
              <Table.HeaderCell>Total Revenue</Table.HeaderCell>
              <Table.HeaderCell>Total Cost</Table.HeaderCell>
              <Table.HeaderCell>Total Profit</Table.HeaderCell>
            </Table.Row>
          </Table.Header>
          <Table.Body>
            {data.length>0?data:<div className="no_data"><h5>No Data</h5></div>}
          </Table.Body>
        </Table>
      </div>
    </div>
  );
}

export default Home;
